
        <style>

        .vanContainer{
          position: absolute;
          bottom: 0;
          left:0;
          width: 20%;
          overflow: visible;
          float:left;
          padding-top:5%;
          padding-left:5%;
          padding-right:5%;
        }

        .cloudContainer{
          position: absolute;
          top: 0;
          right:0;
          width: 10%;
        }

        @keyframes rotateBack{
          from {
            transform: rotate(0deg);
            transform-origin: 22.5% 87.45%;
          }
          to {
            transform: rotate(-359deg);
            transform-origin: 22.5% 87.45%;
          }
        }

        @keyframes rotateFront{
          from {
            transform: rotate(0deg);
            transform-origin: 50.5% 91.5%;
          }
          to {
            transform: rotate(-359deg);
            transform-origin: 50.5% 91.5%;
          }
        }

          @keyframes bounce{
             0%   { transform: scale(1,1)      translateY(0); }
            10%  { transform: scale(1.1,.9)   translateY(0); }
            30%  { transform: scale(.9,1.1)   translateY(-30%); }
            50%  { transform: scale(1.05,.95) translateY(0); }
            57%  { transform: scale(1,1)      translateY(-7px); }
            64%  { transform: scale(1,1)      translateY(0); }
            100% { transform: scale(1,1)      translateY(0) ; }
          }

          @keyframes cloud{
            from {
              transform: translateX(0vw);
            }
            to {
              transform: translateX(-100vw);
            }
          }


        #all{ animation: bounce 4s cubic-bezier(0.280, 0.840, 0.420, 1); }
        #spokesB { animation: rotateBack 1s linear infinite;}
        #spokesF { animation: rotateFront 1s linear infinite;}
        #cloud { animation: cloud 20s linear infinite; }


        #brakeList{
          /* float:right; */
          /* text-align:center; */
          line-height:2em;
        }

        #brakeList li{
          font-weight:bold;
        }

        #brakelist ul{
          list-style-type:none;
          text-align:center;
          padding:0;
        }

        </style>
